import React from 'react'
import {Navigate} from 'react-router-dom'

export const ProtectedRoute = ({children}) => {
    //IF token es valido
    const token = localStorage.getItem('token')
    if (!token) return <Navigate to='/' /> 
    return children
}

export default ProtectedRoute;
